    //should return false
    @Test
    public void should_return_false_non_transitive_test_01(){
        String[] words1 = {"great","acting","skills"};
        String[] words2 = {"fine","painting","talent"};
        String[][] pairs = {{"great","fine"},{"drama","acting"},{"skills","talent"}};
        Assert.assertFalse(new SimilarSentences().areSentencesSimilar(words1, words2, pairs, false));
    }
    @Test
    public void should_return_false_non_transitive_test_02(){
        String[] words1 = {"an","extraordinary","meal"};
        String[] words2 = {"a","good","dinner"};
        String[][] pairs = {{"great","good"},{"extraordinary","good"},{"well","good"},{"wonderful","good"},{"excellent","good"},{"fine","good"},{"nice","good"},{"any","one"},{"some","one"},{"unique","one"},{"the","one"},{"an","one"},{"single","one"},{"a","one"},{"truck","car"},{"wagon","car"},{"automobile","car"},{"auto","car"},{"vehicle","car"},{"entertain","have"},{"drink","have"},{"eat","have"},{"take","have"},{"fruits","meal"},{"brunch","meal"},{"breakfast","meal"},{"food","meal"},{"dinner","meal"},{"super","meal"},{"lunch","meal"},{"possess","own"},{"keep","own"},{"have","own"},{"extremely","very"},{"actually","very"},{"really","very"},{"super","very"}};
        Assert.assertFalse(new SimilarSentences().areSentencesSimilar(words1, words2, pairs, false));
    }

    //Similar with Transitive similarity (a sim b) && (b sim c) implies (a sim c)

    //true
    @Test
    public void should_return_true_transitive_test_01() {
        String[] words1 = {"a","b","c"};
        String[] words2 = {"c","e","f"};
        String[][] pairs = {{"a","b"},{"b","c"},{"b", "z"}, {"z", "e"}, {"c", "x"},{"x", "y"},{"y", "f"}};
        Assert.assertTrue(new SimilarSentences().areSentencesSimilar(words1, words2, pairs, true));

    }

